 ('1', '1', 'ru', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'height--standart', NULL, NULL, '2017-04-27 15:30:00', '2017-04-27 15:30:00', '0a567a65-49bb-48fd-a073-df8330f38c3c'),
 ('2', '2', 'ru', 'Welcome to Bti2.dev!', '<p>It’s true, this site doesn’t have a whole lot of content yet, but don’t worry. Our web developers have just installed the CMS, and they’re setting things up for the content editors this very moment. Soon Bti2.dev will be an oasis of fresh perspectives, sharp analyses, and astute opinions that will keep you coming back again and again.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'height--standart', NULL, NULL, '2017-04-27 15:30:05', '2017-04-27 15:38:55', '090c19c3-39cd-45e0-b4fb-1a0938037648'),
 ('3', '3', 'ru', 'We just installed Craft!', '<p>Craft is the CMS that’s powering Bti2.dev. It’s beautiful, powerful, flexible, and easy-to-use, and it’s made by Pixel &amp; Tonic. We can’t wait to dive in and see what it’s capable of!</p>\n<!--pagebreak-->\n<p>This is even more captivating content, which you couldn’t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.</p>\n<p>Craft: a nice alternative to Word, if you’re making a website.</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'height--standart', NULL, NULL, '2017-04-27 15:30:05', '2017-04-28 09:58:29', 'e41747ff-6356-469a-8236-b3a12a50232c'),
