 ('8', '3', '2', '1', 'ru', '2', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"We just installed Craft!\",\"slug\":\"we-just-installed-craft\",\"postDate\":1493307000,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Craft is the CMS that\\u2019s powering Bti2.dev. It\\u2019s beautiful, powerful, flexible, and easy-to-use, and it\\u2019s made by Pixel & Tonic. We can\\u2019t wait to dive in and see what it\\u2019s capable of!<\\/p>\\r\\n<hr class=\\\"redactor_pagebreak\\\" style=\\\"display:none\\\" unselectable=\\\"on\\\" contenteditable=\\\"false\\\">\\r\\n<p>This is even more captivating content, which you couldn\\u2019t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.<\\/p>\\r\\n<p>Craft: a nice alternative to Word, if you\\u2019re making a website.<\\/p>\",\"2\":\"\",\"33\":[\"22\"]}}', '2017-04-28 09:58:10', '2017-04-28 09:58:10', '51143691-4119-4e44-9bc2-3e91798eac08'),
 ('9', '3', '2', '1', 'ru', '3', '', '{\"typeId\":\"2\",\"authorId\":\"1\",\"title\":\"We just installed Craft!\",\"slug\":\"we-just-installed-craft\",\"postDate\":1493307000,\"expiryDate\":null,\"enabled\":1,\"parentId\":null,\"fields\":{\"1\":\"<p>Craft is the CMS that\\u2019s powering Bti2.dev. It\\u2019s beautiful, powerful, flexible, and easy-to-use, and it\\u2019s made by Pixel & Tonic. We can\\u2019t wait to dive in and see what it\\u2019s capable of!<\\/p>\\r\\n<hr class=\\\"redactor_pagebreak\\\" style=\\\"display:none\\\" unselectable=\\\"on\\\" contenteditable=\\\"false\\\">\\r\\n<p>This is even more captivating content, which you couldn\\u2019t see on the News index page because it was entered after a Page Break, and the News index template only likes to show the content on the first page.<\\/p>\\r\\n<p>Craft: a nice alternative to Word, if you\\u2019re making a website.<\\/p>\",\"2\":\"\",\"33\":\"\"}}', '2017-04-28 09:58:29', '2017-04-28 09:58:29', '1c54a02b-733f-424b-afb8-7c4007a5720f'),
